            <text class="cls-59" transform="translate(479.8 90.61)">“I WAS TALKING TO MY NURSE NAVIGATOR THE OTHER DAY
              <tspan x="4.4" y="46">ABOUT HOW HARD IT IS TO BE ABLE TO TAKE CARE OF MY
              </tspan>
              <tspan x="4.68" y="92">GRANDSON WHILE TRYING TO FIGHT THIS ILLNESS.
              </tspan>
              <tspan x="4.4" y="138">ANYHOW, I MENTIONED TO HER THAT I’VE BEEN GETTING
              </tspan>
              <tspan x="4.66" y="184">HEADACHES SINCE BEING ON MY MEDICATION. SHE TOLD
              </tspan>
              <tspan x="4.42" y="230">ME THAT I SHOULD CALL YOU ABOUT IT…I’VE BEEN
              </tspan>
              <tspan x="2.9" y="276">TRANSFERRED TWICE AND ON HOLD FOR 15 MINUTES SO I
              </tspan>
              <tspan x="4.66" y="322">HOPE I’M AT THE RIGHT PLACE NOW.”</tspan>
            </text>
